Verenigde Staten / Duitsland
Horror / Science-Fiction
108 minuten

een goeie film

met Dennis Quaid, Ben Foster en Cam Gigandet

Payton (Dennis Quaid) en Bower (Ben Foster) zijn twee ruimtereizigers die wakker worden op hun schip zonder dat ze nog weten wat 
hun missie was. Als ze door wat wazige herinneringen proberen uit te vinden wat hun doel was op deze missie, komen ze erachter 
dat ze niet alleen zijn, maar dat ''iets'' het op hen heeft gemunt...
